import React from 'react';
import Box from '@material-ui/core/Box';
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";

import TelegramIcon from "../../lib/assets/img/telegram-icon.png";
import TwitterIcon from "../../lib/assets/img/twitter-icon.png";
import DiscordIcon from "../../lib/assets/img/discord-icon.png";
import RedditIcon from "../../lib/assets/img/reddit-icon.png";

import useStyles from './FooterSocialLinksStyles';

function FooterSocialLings(props) {
  const classes = useStyles();

  <Box display="flex" flexDirection="row">
    <List display="flex" flexDirection="row" justifyContent="flex-center">
      <ListItem className={classes.listItem}>
        <a href="https://t.me/LetsGetPampyChat">
          <img src={TelegramIcon} className={socialIcon}  />
        </a>
      </ListItem>
      <ListItem className={classes.listItem}>
        <a href="https://twitter.com/CoinPampy">
          <img src={TwitterIcon} className={socialIcon}  />
        </a>
      </ListItem>
      <ListItem className={classes.listItem}>
        <a href="https://discord.com/invite/4GZJYF72">
          <img src={DiscordIcon} className={socialIcon}  />
        </a>
      </ListItem>
      <ListItem className={classes.listItem}>
        <a href="https://www.reddit.com/r/PAMPY/">
          <img src={RedditIcon} className={socialIcon} />
        </a>
      </ListItem>
    </List>
  </Box>
};

export default FooterSocialLinks;
